window.bookSummaryJSON = "<p>Adventurers never die, they just fade away.</p> <p>They called him Sven, the Shatterfist. One of a group of heroes who fought the Demon Lord Mannon. He's finally returned home.</p> <p>But for Sven, after returning from abroad, life isn't what it used to be. Adventuring isn't what it used to be. Things have changed. Something is different.</p> <p>The obvious next step? Retire. Settle down. Start his own tavern. Drink with magic girls.</p> <p>Maybe not in that order.</p>"; 
